import React from 'react';
import { Route, Switch, BrowserRouter } from 'react-router-dom';
import './App.css';
import registerView from './views/Register';

function App() {
  return (
    <div className='App'>
      <BrowserRouter>
        <Switch>
          <Route
            path='/authentication/register'
            render={(props) => <registerView {...props} />}
          ></Route>
        </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
